import './GameHeader.css'
import React from 'react'
import { Link } from 'react-router-dom'

function GameHeader(
    props: {
        game_id: string,
        game_over: boolean
    }
) {
    return (
        <>
            <div className="game-header-wrapper">
                <h1 className="game-header id">Game ID : {props.game_id}</h1>
                <h3 className="game-header state">({!props.game_over ? "ongoing" : "over"})</h3>
                <Link to="/">
                    <button className="go-to-main-page-btn">Main Page</button>
                </Link>
            </div>
            <hr className="game-header separator" />
        </>
    )
}

export default GameHeader
